import AppContext from "./AppContext"
import { useState } from "react"

const AppProvider = ( {children} ) =>{
    const [getText, setText] = useState('')

    return (
        <AppContext.Provider value={{
            getText, 
            setText,
            }}>
            {children}    
        </AppContext.Provider>
    )

}



export default AppProvider
